  GoogleLoginButton,
  GithubLoginButton,
} from "react-social-login-buttons";

const Login = (props) => {
  return (
    <div>
      <h1>login</h1>
      <GoogleLoginButton />
      <GithubLoginButton />
    </div>
  );
};

export default Login;
